import React,{ Component } from 'react';
import './App.css';
import Logged from './components/Logged';

// import {
//   BrowserRouter as Router,
//   Route,
//   Link
// } from 'react-router-dom'


export default class App extends Component {
  static state={
    title:['Critical Hit'],
    url:['http://placehold.it/300x300'],
    train_score:[0.8],
    test_score:[0.9],
  }
  render() {
    const info=this.state.title.map(function(item,index){
      <Logged url={this.state.url[index]} title={this.state.title} train_score={this.state.train_score} test_score={this.state.test_score} />
    })
    return (
      <div>
      <nav className='bg-dark navbar-expand-lg text-right p-1'>
        <a href="#null" className=''>Login</a>
      </nav>
      {info}
      </div>
    )
  }
}
